package cn.com.evo.integration.guangxi.content.xml.model;import javax.xml.bind.annotation.XmlAttribute;import javax.xml.bind.annotation.XmlRootElement;import javax.xml.bind.annotation.XmlType;/** * @Description: * @author: lu.xin * @create: 2019-05-14 2:03 PM **/@XmlRootElement(name = "Content")@XmlType(propOrder = {        "value",})public class Content {    private String value;    public Content() {    }    public Content(String value) {        this.value = value;    }    @XmlAttribute(name = "Value")    public String getValue() {        return value;    }    public void setValue(String value) {        this.value = value;    }}